import "./HeroimgStyles.css";

import React from 'react'

import IntroImg from "../assets/img8.jpg"

const Heroimg = () => {
  return (
    <div className="hero">
        <div className="mask">
            <img className="intro-img" 
            src={IntroImg}
            
            
            />
        </div>
    </div>
  )
}

export default Heroimg
